    fetch("http://localhost:6969/signup", {
      method: "post",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        name: name,
        email: email,
        password: password,
        username: username,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        notify();
        console.log(data);
      });
  }



  return (
    <div className="signIn">
      <div className="">
        <div className="loginForm">
          <img src={logo} className="signUplogo" alt="" />
          <div>
            <input type="email" id="email" name="email" placeholder="email" onChange={(e)=>{setEmail(e.target.value)}} />
          </div>
          <div>
            <form action="">
            <input
              type="password"
              id="password"
              name="password"
              placeholder="Password"
              autoComplete="off"
              onChange={(e) => {
                setPassword(e.target.value);
              }}
            />
            </form>
          </div>
          <input type="submit" id="login-btn" value="Sign In" />
        </div>
        <div className="loginForm2">
          Don't have an account ?
          <Link to="/signup">
            <span style={{ color: "blue", cursor: "pointer" }}> Sign Up</span>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
